import React from 'react';
import './Menu.css';

function Menu() {
    return (
        <div className="menu-container">
            <h1>Bem-vindo ao Sistema de Ferramenta Manual</h1>
            <ul>
                <li>Sub-item 1</li>
                <li>Sub-item 2</li>
                <li>Sub-item 3</li>
            </ul>
        </div>
    );
}

export default Menu;
